package aoc.y2018

import scala.annotation.tailrec

object Day5:
  import scala.collection.parallel.CollectionConverters.*

  private val regex = ('a' to 'z')
    .flatMap: c =>
      Seq(s"$c" + s"${c.toUpper}", s"${c.toUpper}" + s"$c")
    .mkString("|")
    .r

  @tailrec private def react(acc: String): String =
    regex.replaceFirstIn(acc, "") match
      case `acc` => acc
      case res   => react(res)

  def solve(input: String): Int = react(input).length

  def solve2(input: String): Int =
    (for ch <- ('a' to 'z').par
    yield react(s"[$ch${ch.toUpper}]".r.replaceAllIn(input, "")).length).min

  val input =
    """"""
